import { StyleSheet } from "react-native";
const css = StyleSheet.create({
    fundo: {
      flex: 1,
      backgroundColor: '#2e2e2e',
    },
    container1:{
      flex: 1,
      //backgroundColor: '#fff',
      justifyContent: 'center',
      alignItems: 'center'
    },
    container2:{
      flex:1,
      //backgroundColor: '  ',
      flexDirection: 'row',
      justifyContent: 'center',
      alignItems: 'center'
    },
    button1:{
      marginRight: 50
    },
    button2:{
      marginLeft: 50
    }
  });
  export {css};
